const BOX_BORDER = "1px solid #e6e6e6";
const BORDER_RADIUS = "4px";


export default {
    maxWidth: "935px",
    bgColor: "#FAFAFA",
    blackColor: "#262626",
    blueColor: "#3897f0",
    darkBlueColor: "#003569",
    darkGreyColor:"#999",
    lightGreyColor:"#c7c7c7",
    redColor:"#ED4956",
    boxBorder : "1px solid #e6e6e6",
    borderRadius: "4px",
    whiteBox: `border:${BOX_BORDER};
                border-radius:${BORDER_RADIUS};
                background-color:white;
    `
};
